  return (
    <div>
    <Switch>
    <Route path='/quotes'>

    </Route>
    <Route path='/quotes/:quoteId'>

    </Route>
    <Route path='/new-quote'>
      <NewQuote/>
    </Route>

    </Switch>

    </div>
  );
}

export default App;
